import React,  {Component} from "react";

export default class BookCard extends Component {
    constructor(props){
        super(props);
    }
    render() {
        const {bookItems} = this.props; 
        console.log(bookItems[0].title);
        return(
            <div className="card">
                <h4>{bookItems.title}</h4>
                <h5>{bookItems.author}</h5>
            </div>
        );
    }
}
